import React from 'react';
import { NavLink } from "react-router-dom";

function Navibar(){
    return(
        <nav className="navbar-container">
            <NavLink to="/">
                Home
            </NavLink>
            <NavLink to="/about">About</NavLink>
            <NavLink to="/contact">Contact</NavLink>
        </nav>
    );
}

export default Navibar
